import React from 'react';
import styled from "styled-components";

function Login() {
  return (
    <Container>
     <Nav>
     <Nav_logo
        src="/images/profile.jpg"
        alt="logo"/>
            <NavMenu >
                <a>
                    
                    <span>HOME</span>
                </a>
                <a>
                    
                    <span>SKILLz</span>
                </a>
                <a>
                   
                    <span>WORK</span>
                </a>
                <a>
                    
                    <span>Y HOBBIES</span>
                </a>
                <a>
                    
                    <span>ABOUT ME</span>
                </a>
            </NavMenu>
            <Login_Container><Login2>Login</Login2></Login_Container>
        </Nav>
    
        
    </Container>
  )
}

const Container=styled.main`
    height: 100%;
    position:relative;
    overflow:hidden;
    background: url("/images/valoImg.jpg") center no-repeat;
        background-size: cover;
        content:"";
        position: absolute;
        top:0;
        left:0;
        right:0;
        bottom:0;
        z-index:-1;
`
const Nav=styled.nav`
    height: 70px;
    background-color: rgb(255, 48, 64);
    display: flex;
    align-items: center;
    padding: 0 36px;
    overflow:hidden;
    justify-content: space-between;`

const NavMenu=styled.div`
    display: flex;
    flex-flow: row nowrap;
    
    margin-left:35px;
    align-items: center;
    left: 50px;
    margin: 0px;
    padding: 0px;
    position: relative;
    margin-right: auto;
    margin-left: 25px;
    a{
        display: flex;
        align-items: center;
        padding: 0 12px;
        cursor: pointer;
        span{
            font-size:13px;
            letter-spacing:1.42px;
            position: relative;
            white-space: nowrap;

            &:before{
                content: "";
                height: 2px;
                background: white;
                position: absolute; 
                left: 0;
                right: 0;
                bottom: -6px;
                opacity: 0;
                transform-origin: left center;
                transition: all 250ms cubic-bezier(0.25,0.46,0.45,0.94) 0s;
                transform: scaleX(0);
                
            }
        }

        &:hover{
            span:after{
                transform: scaleX(1);
                opacity: 1;
            }
        }
    }
`

const Nav_logo=styled.img`
    position: fixed;
    top:8px;
    left: 20px;
    width: 60px;
    object-fit: contain;
`

const Login2=styled.a`
   background-color: rgba(255, 48, 64,0.8);
   padding: 8px 16px;
   text-transform: uppercase;
   letter-spacing:1.8px;
   border: 1px solid #f9f9f9;
   border-radius:4px;
   transition: all 250ms ease 0s;
   cursor:pointer;

   &:hover{
       background-color:rgb(255, 48, 64);
       color:#000;
       border-color:black;
   }
`

const Login_Container=styled.div`
    flex: 1;
    display:flex;
    justify-content: flex-end;
`



export default Login
